Keputihan yang berwarna coklat dan berdarah, biasanya disertai sakit pada bagian panggul dan jadwal menstruasi Anda tidak teratur.

Cairan keputihan yang keluar berwarna keruh seperti abu-abu atau kekuningan, dapat menandakan adanya penyakit menular seksual seperti gonore. Kondisi keputihan ini kadang juga disertai rasa sakit di bagian panggul dan saat Anda kencing.

Jika cairan keputihan Anda keluar dalam jumlah yang banyak dan dibarengi dengan vagina yang membengkak, nyeri di sekitar vulva, dan gatal-gatal, hal itu bisa disebabkan oleh infeksi jamur vagina

Sedangkan jika keputihan Anda berwarna putih, abu-abu, atau kuning dengan aroma yang amis atau asam, hal itu bisa disebabkan oleh bacterial vaginosis. Kadang kondisi ini juga disertai rasa gatal dan merah di area vagina.

